 cannot be migrated because we do not yet support tickets on recurring events. Remove the tickets or wait to migrate until a path is available (%sRead more%s).'=>'Arrangementet %s kan ikke migreres, fordi vi endnu ikke understøtter billetter på tilbagevendende arrangementer. Fjern billetterne, eller vent med at migrere, indtil en løsning er tilgængelig (%sLæs mere%s).','Unknown strategy applied to this event.'=>'Ukendt strategi anvendt til dette arrangement.','We are reversing your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Vi er ved at vende migreringen af dit websted til det nye system. I denne periode kan %1$sdu ikke oprette, redigere eller administrere dine arrangementer%2$s. Din kalender vil stadig være synlig på dit websted, men nogle frontend-handlinger vil være sat på pause.','Migration in progress'=>'Migrering i gang','(Estimated time: %1$s minute)'=>'(Estimeret tid: %1$s minut)','(Estimated time: %1$s minutes)'=>'(Estimeret tid: %1$s minutter)','Start migration'=>'Start migrering','Preview completed'=>'Forhåndsvisning afsluttet','Your system doesn\'t allow us to run a preview, but you can still try a migration. During migration, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Dit system forhindrer os i at lave en forhåndsvisning, men du kan stadig prøve at migrere. Under migreringen %1$s kan du ikke oprette eller redigere begivenheder. %2$s Din kalender vil stadig være synlig på dit site.','Start migration preview'=>'Start forhåndsvisning af migrering','We\'ll scan your events and let you know how long your migration will take. The preview runs in the background, so you\'ll be able to continue using your site.'=>'Vi scanner dine begivenheder og fortæller dig, hvor længe migreringen vil tage. Forhåndsvisningen kører i baggrunden, så du kan fortsætte med at bruge dit site.','Ready to go? The first step is a migration preview.'=>'Er du klar? Første skridt er en forhåndsvisning af migreringen.','We\'re scanning your existing events so you\'ll know what to expect from the migration process. You can keep using your site and managing events. Check back later for the next step of migration.'=>'Vi scanner dine eksisterende begivenheder, så du ved, hvad du kan forvente af migreringsprocessen. Imens kan du bruge dit site og administrere begivenheder. Kig forbi senere for at få oplysninger om næste skridt i migreringen.','Total events previewed:'=>'I alt begivenheder forhåndsvist:','From this preview, we estimate that the full migration process will take approximately %3$d minutes. During this time, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Ud fra denne forhåndsvisning anslår vi, at den fulde migreringsproces vil tage ca. %3$d minutter. I dette tidsrum vil %1$sdu ikke kunne oprette, redigere eller administrere dine begivenheder.%2$s Din kalender vil stadig være synlig på din hjemmeside.','The migration preview is done and ready for your review. No changes have been made to your events, but this report shows what adjustments will be made during the migration to the new system. If you have any questions, please %1$sreach out to our support team%2$s.'=>'Forhåndsvisningen af migreringen er færdig og klar til din gennemgang. Der er ikke foretaget ændringer i dine events, men denne rapport viser, hvilke justeringer der vil blive foretaget under migreringen til det nye system. Hvis du har spørgsmål, er du velkommen til at %1$skontakte vores supportteam%2$s.','Migration preview in progress'=>'Forhåndsvisning af migration i gang','Learn more about the migration'=>'Få mere at vide om migrationen','https://evnt.is/1b79'=>'https://evnt.is/1b79','Preview complete'=>'Forhåndsvisning færdig','We\'ve completely revamped the way event information is stored on your site\'s database. Upgrade now to take advantage of faster calendar load times and improved performance. As with any significant site change, we recommend %screating a site backup%s before beginning the migration process.'=>'Vi har fuldstændig moderniseret den måde, eventinformation gemmes på i din hjemmesides database. Opgrader nu for at drage fordel af hurtigere kalenderindlæsningstider og forbedret ydeevne. Som med alle større ændringer på siden anbefaler vi, at du %sopretter en sikkerhedskopi af siden%s, før du begynder migreringsprocessen.','Get ready for the new recurring events!'=>'Gør dig klar til nye tilbagevendende begivenheder!','Plugins Page'=>'Plugin-siden','unknown'=>'ukendt','Upgrade is not Available'=>'Opgradering er ikke tilgængelig','You must update your version of Events Calendar Pro for access to calendar upgrades.'=>'Du er nødt til at opdatere din version af Events Calendar Pro for at få adgang til kalenderopdateringer.','Show past %1$s'=>'Vis forrige %1$s','Upgrade your event data storage system.'=>'Opgrader dit system til lagring af eventdata.','To safely cancel the migration, we need to reverse the process on any data that has already been modified. Your site will remain in maintenance mode until we have safely reversed the process.'=>'For at annullere migreringen på en sikker måde er vi nødt til at vende processen for alle data, der allerede er blevet ændret. Din side vil forblive i vedligeholdelsestilstand, indtil vi har vendt processen sikkert.','ID %1$d (Untitled)'=>'ID %1$d (Uden titel)','Upgrade FAQ'=>'FAQ om opgradering','Version Compatibility'=>'Versionskompatibilitet','Show more upcoming %1$s'=>'Vis flere kommende %1$s','Re-run preview'=>'Forhåndsvisning af preview','Resources'=>'Ressourcer','Are you sure you want to reverse the recurring event system migration process?

- You will no longer be able to use the new recurring event and Series features.
- All event edits you have made since migration will be lost.
- As with migration, you will not be able to edit events or calendar options during this process and some frontend actions will be paused.
- Reverse migration should take less time than the original migration, but there is no time estimate available.
'=>'Er du sikker på, at du vil vende migreringsprocessen for systemet til tilbagevendende begivenheder?

- Du vil ikke længere kunne bruge de nye funktioner til tilbagevendende begivenheder og serier.
- Alle redigeringer af begivenheder, du har foretaget siden migreringen, vil gå tabt.
- Som med migreringen vil du ikke kunne redigere begivenheder eller kalenderindstillinger under denne proces, og nogle frontend-handlinger vil blive sat på pause.
- Omvendt migrering bør tage kortere tid end den oprindelige migrering, men der er ikke noget tidsestimat tilgængeligt.
','Upgrade your events'=>'Opgrader dine begivenheder','We’ve detected that your site was still using our legacy calendar design. As part of the update to The Events Calendar 6.0, <strong>your calendar was automatically upgraded to the new designs.</strong>'=>'Vi har opdaget, at din side stadig brugte vores gamle kalenderdesign. Som en del af opdateringen til The Events Calendar 6.0 blev <strong>din kalender automatisk opgraderet til det nye design.</strong>','The Events Calendar guide'=>'The Events Calendar guide','View your calendar'=>'Vis din kalender','Our support page for TECcontact support'=>'kontakt supporten','Read more about deprecation of legacy views.read the FAQs'=>'læs FAQ\'en','%s must be a valid HTML color code.'=>'%s skal være en gyldig HTML-farvekode.','Use this image'=>'Brug dette billede','Select Image'=>'Vælg billede','Remove Image'=>'Fjern billede','Your calendar’s design has changed'=>'Din kalenders design er blevet ændret','Event Tickets REST API is not available.'=>'Event Tickets REST API er ikke tilgængelig.','Event Tickets plugin is not activated.'=>'Event Tickets plugin er ikke aktiveret.','Troubleshooting Page'=>'Fejlfindingsside','Add to calendar'=>'Tilføj til kalender','Outlook Live'=>'Outlook Live','Outlook 365'=>'Outlook 365','Add Donations'=>'Tilføj donationer','The best WordPress donation plugin.'=>'Det bedste WordPress-plugin til donationer.','(View Full %1$s Description Here: %2$s)'=>'(Se fuld %1$s beskrivelse her: %2$s)','Export Outlook .ics file'=>'Eksport Outlook .ics-fil','The text used for the link to the event archive in the admin post tag list.%s View'=>'%s Visning','GiveWP makes it easy to raise money online with donation forms, donor databases, and fundraising reporting.'=>'GiveWP gør det nemt at indsamle penge online med donationsformularer, donordatabaser og fundraising-rapportering.','Easy-to-use WooCommerce plugins work perfectly together, with any theme. Create a fast and profitable eCommerce store without any technical knowledge.
					'=>'Brugervenlige WooCommerce-plugins fungerer perfekt sammen med ethvert tema. Opret en hurtig og rentabel eCommerce-butik uden nogen teknisk viden.','Add Commerce Tools'=>'Tilføj handelsværktøjer','Sales-boosting WooCommerce plugins.'=>'Salgsfremmende WooCommerce-plugins.','Kadence lets you unlock your creativity in the WordPress Block Editor with expertly designed blocks, a robust theme, and a massive library of starter templates.'=>'Kadence lader dig frigøre din kreativitet i WordPress Block Editor med ekspertdesignede blokke, et robust tema og et massivt bibliotek af startskabeloner.','Add Starter Templates'=>'Tilføj startskabeloner','Restrict Content Pro is flexible, easy to extend, and chock full of action hooks and filters, making it easy to modify and tweak to your specific needs.'=>'Restrict Content Pro er fleksibelt, nemt at udvide og fyldt med actionhooks og filtre, der gør det nemt at ændre og tilpasse til dine specifikke behov.','Add Content Restriction'=>'Tilføj begrænsning af indhold','Built with developers in mind.'=>'Bygget med udviklere i tankerne.','Add Security'=>'Tilføj sikkerhed','Add Courses'=>'Tilføj kurser','The online course platform created by e-learning experts.'=>'Online kursusplatform skabt af e-learning-eksperter.','$25 towards any Stellar product using code <u>%s</u>'=>'$25 til et Stellar-produkt ved brug af koden <u>%s</u>.','Stellar is a collective of WordPress innovators, and home to WordPress products done right.'=>'Stellar er et kollektiv af WordPress-innovatører og hjemsted for WordPress-produkter, der er gjort rigtigt.','Stellar Discounts'=>'Stellar-rabatter','To begin using %2$s, please install (or upgrade) and activate %3$s.'=>'For at begynde at bruge %2$s skal du installere (eller opgradere) og aktivere %3$s.','USD'=>'USD','Link to full description. %1$s: pre=translated event term. %2$s: event url. (View Full %1$s Description Here: %2$s)'=>' (Se hele %1$s-beskrivelsen her: %2$s)','Default currency code'=>'Standardvalu