e TEC Customizer section.Customize The Events Calendar'=>'Tilpas The Event Calender','Meta box title for the Event StatusEvents Status'=>'Status for begivenheder','Canceled label.Canceled'=>'Annulleret','Postponed labelPostponed'=>'Udskudt','The description of the List Widget.Shows a list of upcoming events.'=>'Viser en liste over kommende begivenheder.','Label for event status reason fieldReason (optional)'=>'Årsag (valgfri)','The label of the event status select.Set status:'=>'Angiv status:','Adjust colors, fonts, and more with the WordPress Customizer.'=>'Tilpas farver, skrifttyper med mere, med WordPress Customizer.','Event status label the select fieldSet status:'=>'Angiv status:','Error status label for system info optinStatus:'=>'Status:','Error code label for system info optinCode:'=>'Kode:','Default error message for system info optinSomething has gone wrong!'=>'Noget er gået galt!','Copy to clipboard instructionsPress "Cmd + C" to copy'=>'Tryk på "Cmd + C" for at kopiere','Copy to clipboard success messageSystem info copied'=>'Systeminfo kopieret','Copy to clipboard button text.Copy to clipboard'=>'Kopier til udklipsholder','The event accent color setting label.Accent Color'=>'Fremhævet farve','Label for option to set a custom color.Select Custom Color'=>'Vælg brugerdefineret felt','The font size selector setting label.By Scale'=>'Via skalering','The base font size input setting label.By Pixel'=>'Via pixel','Label for option to use theme fonts.Inherit theme font(s)'=>'Nedarv temaet font(s)','The description for the base font size setting.Choose a base font size. Event text will scale around the selected base size.'=>'Vælg en basis skrifttype. Begivenhedstekst vil skalere omkring den valgte basisstørrelse.','Set Font Size'=>'Indstil skrifttype','Select Font Family'=>'Vælg Skrifttype familie','Label for option to use default TEC fonts.Default'=>'Standard','The event title color setting label.Event Title'=>'Begivenheds overskrift','The event title color setting label.Event Date and Time'=>'Dato og klokkeslæt for begivenheden','The description for the event date and time color setting.Main date and time display on views and single event pages'=>'Vigtigste dato og klokkeslæt vises på visninger og sider med en enkelt begivenhed','The link color setting label.Link Color'=>'Linkfarve','Options selected here will override what was selected in the "Global Elements" section on Single Event views.'=>'De indstillinger du vælger her, vil overskrive dem, du har valgt i "General Theme" og "Global Elements" sektioner.','Label for option to leave transparent (default).Transparent.'=>'Gennemsigtig.','Events Aggregator'=>'Aggregator af begivenheder','Import events with ease'=>'Importer nemt begivenheder','Effortlessly fill your calendar with events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Du kan nemt udfylde din kalender med begivenheder fra Meetup, Eventbrite, iCal, Google Calendar og meget mere.','News from The Events Calendar'=>'Nyheder fra The Events Calendar','Events Bar'=>'Begivenhedsbjælke','The header for the color control section.Adjust Appearance'=>'Juster udseende','The events bar text color setting label.Text Color'=>'Tekstfarve','The "Find Events" button text color setting label.Find Events Button Text'=>'Tekst til knappen Find begivenheder','The Events Bar icon color setting label.Icons'=>'Ikoner','Label for the default option.Default'=>'Standard','Label for option to use the accent color. Links to the accent color setting.Use the <a href="%1$s">Accent Color</a>'=>'Brug <a href="%1$s">accentfarven</a>','The Events Bar background color setting label.Background Color'=>'Baggrundsfarve','The Events Bar border color setting label.Border Color'=>'Kantfarve','Label for option to use the events background color. Links to the background color setting.Use the Calendar <a href="%1$s">Background Color</a>'=>'Brug <a href="%1$s">kalenderens baggrundsfarve</a>','Label for option to use the accent color (default). Links to the accent color setting.Use the <a href="%1$s">Accent Color</a>'=>'Brug <a href="%1$s">kontrastfarven</a>','Note about what these settings control.These settings control the search and options bar that appears above calendar views.'=>'Disse indstillinger styrer søge- og indstillingslinjen, der vises over kalendervisninger.','Label for option to use the event background color. Links to the event background color setting.Use the <a href="%1$s">General Background Color</a>'=>'Brug <a href="%1$s">Generel baggrundsfarve</a>.','The Events Calendar, Event Tickets and their add-ons integrate with other online tools and services to bring you additional features. Use the settings below to connect to third-party APIs and manage your integrations.'=>'The Events Calendar, Event Tickets og dens tilføjelser kan integreres med andre online værktøjer og tjenester for at give dig yderligere funktioner. Brug indstillingerne nedenfor til at oprette forbindelse til API\'er fra tredjeparter og administrere dine integrationer.','The Events Calendar does not send any user data outside of your website by default.'=>'The Events Calendar sender som standard ikke brugerdata uden for dit websted.','Create Eventbrite tickets and events right from your WordPress dashboard.'=>'Opret Eventbrite-billetter og begivenheder direkte fra dit WordPress-dashboard.','Enable 3rd party event submissions.'=>'Aktiver indsendelser af tredjepartsbegivenheder.','Allow users to search for events by category, tag, venue, organizer, day of the week, time of day, and price.'=>'Tillad brugere at søge efter begivenheder efter kategori, tag, sted, arrangør, ugedag, tidspunkt på dagen og pris.','Email marketing to promote your events'=>'E-mail marketing for at promovere dine begivenheder','Collect RSVPs and sell tickets'=>'Saml svar og sælg billetter','Import events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Importer begivenheder fra Meetup, Eventbrite, iCal, Google Kalender og mere.','The #1 calendar for WordPress'=>'#1-kalenderen til WordPress','There are a few %s to resolve and prevent 404 errors.'=>'Der er et par %s, der skal løses og forhindre 404-fejl.','I keep getting “Page Not Found” on events.'=>'Jeg bliver ved med at få "Page Not Found" om begivenheder.','%s and other common installation issues.'=>'%s og andre almindelige installationsproblemer.','I installed the calendar and it crashed my site.'=>'Jeg installerede kalenderen, og den styrtede ned på mit websted.','This can happen when other plugins try to improve performance. %s.'=>'Dette kan ske, når andre plugins forsøger at forbedre ydeevnen. %s.','My calendar doesn’t look right.'=>'Min kalender ser ikke rigtig ud.','Here’s an overview of %s and what they mean.'=>'Her er en oversigt over %s og hvad de betyder.','Common Error Messages'=>'Almindelige fejlmeddelelser','Check for updates'=>'Søg efter opdateringer','It\'s important to use the most recent versions of our plugins so that you have access to the latest features, bug fixes, and security updates. Plugin functionality can be compromised if your site is running outdated or mis-matched versions.'=>'Det er vigtigt at bruge de nyeste versioner af vores plugins, så du har adgang til de nyeste funktioner, fejlrettelser og sikkerhedsopdateringer. Plugin-funktionalitet kan kompromitteres, hvis dit websted kører forældede eller ikke-matchende versioner.','Plugin(s) are out of date'=>'Plugin(s) er forældede','Enter a custom API key'=>'Indtast en tilpasset API-nøgle','The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins, dynamic map loads, or Events Calendar Pro\'s Location Search and advanced Map View, you’ll need to get your own Google Maps API key and add it to Events > Settings > Integrations'=>'Begivenhedskalenderen leveres med en API-nøgle til grundlæggende kortfunktionalitet. Hvis du gerne vil bruge mere avancerede funktioner såsom brugerdefinerede kortnåle, dynamiske kortindlæsninger eller Events Calendar Pros placeringssøgning og avanceret kortvisning, skal du få din egen Google Maps API-nøgle og tilføje den til Begivenheder > Indstillinger > Integrationer','Default Google Maps API key'=>'Standard Google Maps API-nøgle','Manage your licenses'=>'Administrer dine licenser','License keys can only be used on a limited number of sites, which varies depending on your license level. You\'ll need to remove the license from one or more other site\'s in order to use it on this one.'=>'Licensnøgler kan kun bruges på et begrænset antal websteder, som varierer afhængigt af dit licensniveau. Du skal fjerne licensen fra et eller flere andre websteder for at kunne bruge det på denne.','Install max has been reached'=>'Installationsmaksimum er nået','Adjust your timezone'=>'Juster din tidszone','When using The Events Calendar, we highly recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “UTC+9”. Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. Go to your the General WordPress settings to adjust your site timezone.'=>'Når du bruger begivenhedskalenderen, anbefaler vi stærkt, at du bruger en geografisk tidszone såsom "America/Los_Angeles" og undgår at bruge en UTC-tidszoneforskydning såsom "UTC+9". At vælge en UTC-tidszone for dit websted eller individuelle begivenheder kan forårsage problemer ved import af begivenheder eller med sommertid. Gå til dine generelle WordPress-indstillinger for at justere dit websteds tidszone.','Display Custom HTML'=>'Vis tilpasset HTML','Hide Others’ Organizers and Venues'=>'Skjul andres arrangører og spillesteder','This extension adds the “Show Google Maps” and “Show Google Maps Link” checkboxes when creating a new Venue.'=>'Denne udvidelse tilføjer afkrydsningsfelterne "Vis Google Maps" og "Vis Google Maps Link", når du opretter et nyt mødested.','Site time zone uses UTC'=>'Webstedets tidszone bruger UTC','This extension allows you to add custom HTML content to the top of the Community submission form.'=>'Denne udvidelse giver dig mulighed for at tilføje tilpasset HTML-indhold til toppen af indsendelsesformularen til fællesskabsbegivenheder.','This extension allows you to hide the Organizers and Venues that a visitor has not created from the Community submission form.'=>'Denne udvidelse giver dig mulighed for at skjule de arrangører og spillesteder, som en besøgende ikke har oprettet, fra indsendelsesformularen til fællesskabsbegivenheder.','Add Google Maps Display and Link Options'=>'Tilføj Google Maps visnings- og linkindstillinger','This extension allows you to set default currency symbols for your users to choose from instead of having a plain text field.'=>'Denne udvidelse giver dig mulighed for at indstille standardvalutasymboler, som dine brugere kan vælge imellem i stedet for at have et almindeligt tekstfelt.','Add Cost Currency Symbol'=>'Tilføj omkostningsvalutasymbol','This extension will send an email to event organizers whenever a user registers for their event.'=>'Denne udvidelse sender en e-mail til begivenhedsarrangører, hver gang en bruger tilmelder sig deres begivenhed.','Organizer Notification Email'=>'Arrangørmeddelelses-e-mail','Displays the information collected by “attendee meta fields” in the WooCommerce order screens as well.'=>'Viser også oplysningerne indsamlet af "deltager-metafelter" på WooCommerce-ordreskærmene.','Add Event & Attendee Info to WooCommerce Order Details'=>'Tilføj begivenheds- og deltageroplysninger til WooCommerce-ordreoplysninger','This extension shows a meta box with an API key on each Event with Ticket/RSVP.'=>'Denne udvidelse viser en metaboks med en API-nøgle på hver begivenhed med billet/svar.','Per Event Check In API'=>'Per begivenhed Check-In API','Adds a new settings panel in Events > Settings that gives more control over the ticket and rsvp emails that are sent to attendees after registration.'=>'Tilføjer et nyt indstillingspanel i Begivenheder > Indstillinger, der giver mere kontrol over billet- og rsvp-e-mails, der sendes til deltagere efter registrering.','Ticket Email Settings'=>'Billet-mail-indstillinger','When it comes to paid tickets, these orders can be refunded through the e-commerce platform in use.'=>'Når det kommer til betalte billetter, kan disse ordrer refunderes via den e-handelsplatform, der er i brug.','How do I process refunds for tickets?'=>'Hvordan behandler jeg refusioner for billetter?','Yes! You can easily accomplish this task using the stock options and multiple ticket types available with Event Tickets.'=>'Ja! Du kan nemt udføre denne opgave ved at bruge aktieoptionerne og flere billettyper, der er tilgængelige med begivenhedsbilletter.','Can I have a seating chart associated with my tickets?'=>'Kan jeg få et siddeskema tilknyttet mine billetter?','You can sell tickets using our built-in e-commerce option, or upgrade to Event Tickets Plus to use ecommerce plugins such as WooCommerce.'=>'Du kan sælge billetter ved hjælp af vores indbyggede e-handelsmulighed eller opgradere til Event Tickets Plus for at bruge e-handelsplugins såsom WooCommerce.','How Do I Set Up E-Commerce Plugins for Selling Tickets?'=>'Hvordan opsætter jeg plugins til e-handel til salg af billetter?','We’ve put together a video tutorial showing how to create events with Tickets using our plugins. Click on the link in the link in the title to learn more.'=>'Vi har sammensat en videovejledning, der viser, hvordan du opretter begivenheder med billetter ved hjælp af vores plugins. Klik på linket i linket i titlen for at lære mere.','How Do I create events with Tickets or RSVP’s?'=>'Hvordan opretter jeg begivenheder med billetter eller RSVP\'er?','This extension creates a useful variety of WordPress widget areas (a.k.a. sidebars).'=>'Denne udvidelse skaber et nyttigt udvalg af WordPress-widgetområder (a.