op den nuværende process','The Asynchronous import process is faster and does not rely on WordPress Cron but might not work correctly in all WordPress installations, try switching to the Cron-based process for maximum compatibility.'=>'Den asynkrone importprocess er hurtigere og er ikke afhængig af WordPress Cron, men fungerer ikke altid rigtigt i alle WordPress installationer. Prøv at skifte til den Cron-baserede process for at opnå maksimal kompatibilitet.','Import Process System'=>'Importeringsproces','click here'=>'klik her','If you want to stop and clear current asynchronous import processes %1$s.'=>'Hvis du ønsker at stoppe og rense den nuværende asynkrone importeringsprocess %1$s.','Import from Eventbrite URL'=>'Importer fra Eventbrite URL','to create your own free Google Maps API key.'=>'for at oprette din egen gratis Google Maps API key.','If you do not add your own API key, the built-in API key will always populate this field and some map-related functionality will be limited '=>'Hvis du ikke tilføjer din egen API-Key, vil den indbyggede API-key altid udfylde data i feltet og der vil være begrænsninger i nogle af de kortrelaterede funktioner. ','You are using The Events Calendar\'s built-in Google Maps API key.'=>'Du bruger The Events Calendars indbyggede Google Maps API key.','<p>The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins or dynamic map loads, you’ll need to get your own %1$sGoogle Maps API key</a>. %2$sRead More</a>.</p>'=>'<p>Med The Events Calendar følger en API-key med grundlæggende funktioner. Hvis du ønsker at bruge mere avancerede funktioner som brugerdefinerede kort, knappenål og dynamisk indlæsning af kort, har du brug for din egen %1$sGoogle Maps API-key</a>. %2$sLæs mere</a>.</p>','to learn more about using it with The Events Calendar'=>'for at lære mere om at bruge den sammen med The Events Calendar','Asynchronous'=>'Asynkron','Unsupported'=>'Ikke und