to perfect the gathering and export of all data for your end users. We suggest running a search in your local database, as well as within the WordPress Dashboard, in order to identify all data collected and stored for your specific user requests.'=>'Visse data kan eksporteres eller fjernes på brugernes anmodning via den eksisterende Exporter eller Eraser. Bemærk dog, at der findes adskillige "grænsetilfælde", hvor vi ikke er i stand til at perfektionere indsamling og eksport af alle data for dine slutbrugere. Vi foreslår at køre en søgning i din lokale database, såvel som i WordPress Kontrolpanel, for at identificere alle data, der er indsamlet og gemt for dine specifikke brugeranmodninger.','How Long You Retain this Data'=>'Hvor længe gemmer du disse data','All information (data) is retained in the local database indefinitely, unless otherwise deleted.'=>'Alle oplysninger (data) opbevares i den lokale database på ubestemt tid, medmindre de bliver slettet.','We make use of certain APIs, in order to provide specific features.'=>'Vi gør brug af visse API\'er for at kunne levere specifikke funktioner.','The Events Calendar suite offers the use of third-party API keys. The primary functions are to enhance the features we\'ve built in, some of which use Google Maps, PayPal, Eventbrite, and Meetup. These API keys are not supplied by The Events Calendar.'=>'The Events Calendar tilbyder brug af API-nøgler fra tredjeparter. De primære funktioner er at forbedre de funktioner, vi har indbygget, hvoraf nogle bruger Google Maps, PayPal, Eventbrite og Meetup. Disse API-nøgler leveres ikke af The Events Calendar.','API Keys'=>'API-nøgler','When purchasing Eventbrite Tickets, attendee, purchaser, and order information are stored and managed by Eventbrite.'=>'Når du køber Eventbrite-billetter, gemmes og administreres deltager-, køber- og ordreoplysninger af Eventbrite.','Please note that to create new events through the Community Events submission form, a user must hold a website account on this domain. This information is retained in the local database. It is also possible to create events anonymously, if the site owner has this option enabled.'=>'Bemærk venligst, at for at oprette nye begivenheder via formularen til indsendelse af fællesskabsbegivenheder skal brugeren have en websteds-konto på dette domæne. Disse oplysninger opbevares i den lokale database. Det er også muligt at oprette begivenheder anonymt, hvis webstedsejeren har aktiveret denne mulighed.','Eventbrite Ticket information: name, description, cost, type, quantity'=>'Eventbrite Billetoplysninger: navn, beskrivelse, pris, type, antal','Import origin data (URL from where events are being imported—such as Eventbrite, MeetUp, other compatible URL sources, and more, which can include similar or same data as listed above)'=>'Import af oprindelsesdata (URL-adresse, hvorfra begivenhederne importeres, f.eks. Eventbrite, MeetUp, andre kompatible URL-kilder m.m., som kan indeholde lignende eller de samme data som anført ovenfor)','Suggested text:'=>'Forslået tekst:','Event information: website, cost, description, date, time, image'=>'Begivenhedsoplysninger: hjemmeside, pris, beskrivelse, dato, klokkeslæt, billede','Importing Events, Venues, and Organizers:'=>'Import af begivenheder, arrangementssteder og arrangører:','All data present within a CSV or ICS file and external URLs (for events, venues, organizers, and tickets)'=>'Alle data i en CSV- eller ICS-fil og eksterne URL\'er (for begivenheder, arrangementssteder, arrangører og billetter)','Through the usage of The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets, and Community Events plugins, as well as our Event Aggregator Import service (contained within The Events Calendar plugin), information may be collected and stored within your website’s database.'=>'Ved brug af plugins som The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets og Community Events samt vores Event Aggregator Import service (indeholdt i The Events Calendar plugin), kan oplysninger blive indsamlet og gemt i dit websteds database.','If you create, submit, import, save, or publish Event, Venue, or Organizer information, such information is retained in the local database:'=>'Hvis du opretter, indsender, importerer, gemmer eller offentliggør oplysninger om begivenhed, sted eller arrangør, opbevares sådanne oplysninger i den lokale database:','Venue information: name, address, city, country, state, postal code, phone, website, geographical coordinates (latitude and longitude)'=>'Oplysninger om stedet: navn, adresse, by, land, stat, postnummer, telefon, websted, geografiske koordinater (bredde- og længdegrad)','Organizer information: name, phone, website, email'=>'Oplysninger om arrangøren: navn, telefon, websted, e-mail','None'=>'Ingen','Learn more'=>'Lær mere','Disclaimer:'=>'Ansvarsfraskrivelse:','Hello,'=>'Hej,','Eventbrite Import Settings'=>'Indstillinger for Eventbrite','Import from Eventbrite'=>'Importer fra Eventbrite','Do more with Eventbrite Tickets'=>'Gør mere med Eventbrite billetter','An event having a post meta value of `%s` meridian is not valid. Make sure it is either `am` or `pm`, or remove it entirely if using the 24-hour format.'=>'En begivenhed, der har en post meta-værdi på `%s` meridian, er ikke gyldig. Sørg for, at det enten er `am` eller `pm`, eller fjern det helt, hvis du bruger 24-timersformatet.','An event having a post meta value of `%s` hour (am/pm) is not valid. Make sure it is from 1 to 12.'=>'En begivenhed med en post meta-værdi på `%s` time (am/pm) er ikke gyldig. Sørg for, at den er mellem 1 og 12.','An event having a post meta value of `%s` hour (12-hour) is not valid. Make sure it is from 1 to 12.'=>'En begivenhed med en post meta-værdi på `%s` time (12 timer) er ikke gyldig. Sørg for, at den er mellem 1 og 12.','An event having a post meta value of `%s` hour (24-hour) is not valid. Make sure it is from 0 to 23.'=>'En begivenhed med en post meta-værdi på `%s` time (24 timer) er ikke gyldig. Sørg for, at den er mellem 0 og 23.','An event having a post meta value of `%s` minutes is not valid. Make sure it is from 0 to 59.'=>'En begivenhed med en post meta-værdi på `%s` minutter er ikke gyldig. Sørg for, at den er mellem 0 og 59.','The default post status for events imported via Eventbrite'=>'Standardstatus for indlæg for begivenheder, der importeres via Eventbrite','You should include the information below in the correct sections of you privacy policy.'=>'Du bør medtage oplysningerne nedenfor i de korrekte afsnit af din privatlivspolitik.','What personal data we collect and why we collect it'=>'Hvilke personlige data indsamler vi, og hvorfor vi indsamler det','This information serves as a guide on what sections need to be modified due to usage of The Events Calendar and its Add-ons.'=>'Denne information fungerer som en guide til, hvilke sektioner der skal ændres på grund af brugen af The Events Calendar og dens Add-ons.','This information is only for guidance and not to be considered as legal advice.'=>'Disse oplysninger er kun vejledende og skal ikke betragtes som juridisk rådgivning.','The default event category for events imported via Eventbrite'=>'Standardkategorien for begivenheder, der importeres via Eventbrite','Event, Venue, and Organizer Information'=>'Information om begivenhed, sted og arrangør','Settings > General'=>'Indstillinger > Generelt','Refresh your connection to Eventbrite'=>'Opdater din forbindelse til Eventbrite','Connect to Eventbrite'=>'Forbind til Eventbrite','Invalid Meetup URL'=>'Ugyldigt Meetup URL','Invalid Facebook URL'=>'Ugyldigt Facebook URL','Invalid Eventbrite URL'=>'Ugyldigt Eventbrite URL','You need to connect to Eventbrite for Event Aggregator to work properly'=>'Du skal forbinde til Eventbrite for at Event Aggregator fungerer korrekt','to change how the actual time is displayed on your calendar.'=>'for at ændre hvordan den aktuelle tid bliver 