,'No upcoming Eventbrite events found.'=>'Ingen kommende Eventbrite-begivenheder fundet.','Events cannot be imported because Eventbrite has returned an error. This could mean that the event ID does not exist, the event or source is marked as Private, or the event or source has been otherwise restricted by Eventbrite. You can <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">read more about Eventbrite restrictions in our knowledgebase</a>.'=>'Begivenheder kan ikke importeres, fordi Eventbrite har returneret en fejl. Det kan betyde, at begivenheds-id\'et ikke findes, at begivenheden eller kilden er markeret som privat, eller at begivenheden eller kilden på anden måde er blevet begrænset af Eventbrite. Du kan <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">læse mere om Eventbrite-begrænsninger i vores vidensbase</a>.','Successfully fetched Eventbrite Token'=>'Eventbrite-token er hentet med succes','Please provide a Eventbrite URL when importing from Eventbrite.'=>'Angiv en Eventbrite-URL, når du importerer fra Eventbrite.','Read more'=>'Læs mere','2018 user survey<strong>The Events Calendar Annual Survey:</strong> share your feedback with our team—%1$s!'=>'<strong>The Events Calendar årlige brugerundersøgelse:</strong> del dine oplevelser med vores team—%1$s!','There is an JSON error with the Event Aggregator server. Please try your import again later.'=>'Der er en JSON-fejl med Event Aggregator-serveren. Prøv venligst at importere igen senere.','The import unique ID as provided by Event Aggregator service'=>'Det unikke import-id, som leveres af event aggregator-tjenesten','The hash of the next expected batch, as previously provided by the client'=>'Hash-koden for den næste forventede batch, som tidligere leveret af klienten','The current status of the import.'=>'Den aktuelle status for importen.','The percentage of import completed.'=>'Den procentdel af importen, der er gennemført.','The current 