 begynd at bruge blokredigeringsprogrammet til dine begivenheder!','Looks like you are using Gutenberg on this WordPress installation. %1$s'=>'Det ser ud til, at du bruger Gutenberg på denne WordPress-installation. %1$s','%1$s published. %2$sView %3$s'=>'%1$s offentliggjort. %2$sSe %3$s','The event with the specified ID is not accessible.'=>'Begivenheden med det angivne ID er ikke tilgængelig.','An event with the specified ID does not exist.'=>'Der findes ikke en begivenhed med det angivne ID.','An organizer with the specified event does not exist.'=>'Der findes ikke en arrangør med den angivne begivenhed.','The "/page/" URL string component.page'=>'side','The organizer with the specified ID is not accessible.'=>'Organisatoren med det angivne ID er ikke tilgængelig.','The number of events per page on the List View. Does not affect other views.'=>'Antallet af begivenheder pr. side i listevisningen. Påvirker ikke andre visninger.','%s must not be empty'=>'%s må ikke være tom','Calendar powered by %s'=>'Kalender drevet af %s','The current URL for your events page is %1$s. <br><br> You cannot edit the slug for your events page as you do not have pretty permalinks enabled. In order to edit the slug here, <a href="%2$s">enable pretty permalinks</a>.'=>'Den nuværende URL-adresse for din begivenhedsside er %1$s<br><br> Du kan ikke redigere korttitel for din begivenhedsside, da du ikke har aktiveret smukke permalinks. Du skal <a href="%2$s">aktivere smukke permalinks</a> for at kunne redigere korttitel her.','When importing from an event source, this is the maximum number of events that will be imported; on slower websites this may impact the success of imports. Setting this to a smaller number may improve results.'=>'Når du importerer fra en hændelseskilde, er dette det maksimale antal hændelser, der vil blive importeret; på langsommere websteder kan dette have betydning for, om importen lykkes. Hvis du indstiller dette til et mindre antal, kan det forbedre resultaterne.','The settings below control the display of your calendar. If things don\'t look right, try switching between the two style sheet options or pick a page template from your theme (not available on block themes). '=>'Indstillingerne nedenfor styrer visningen af din kalender. Hvis tingene ikke ser rigtige ud, kan du prøve at skifte mellem de to stilarkindstillinger eller vælge en sideskabelon fra dit tema (ikke tilgængelig på bloktemaer). ','The venue with the specified ID has been deleted already.'=>'Arrangementsstedet med det angivne ID er allerede blevet slettet.','The venue with the specified ID could not be deleted.'=>'Arrangementsstedet med det angivne ID kunne ikke slettes.','The venue author ID'=>'ID for stedets forfatter','The venue publication date'=>'Dato for offentliggørelse af arrangementsstedet','The venue publication date (UTC time zone)'=>'Udgivelsesdatoen for arrangementsstedet (UTC-tidszone)','The venue description'=>'Beskrivelse af stedet','The venue post status'=>'Status for arrangementsstedets indlæg','Whether events linked to the venue should show a map or not'=>'Om begivenheder, der er knyttet til mødestedet, skal vise et kort eller ej','Whether events linked to the venue should show a map link or not'=>'Om begivenheder, der er knyttet til mødestedet, skal vise et kortlink eller ej','The venue state and province'=>'Arrangementssteds region og provins','the venue post name'=>'navnet på arrangementsstedets post','The venue could not be created from the provided data'=>'Det er ikke muligt at oprette stedet ud fra de angivne data','The event could not be deleted'=>'Begivenheden kunne ikke slettes','The event is already trashed'=>'Arrangementet er allerede blevet smidt i papirkurven','The venue could not be deleted'=>'Stedet kunne ikke slettes','The venue is already trashed'=>'Stedet er allerede smidt i papirkurven','The organizer is already trashed'=>'Arrangøren er allerede smidt i papirkurven','The event could not be updated'=>'Begivenheden kunne ikke opdateres','The requested event term archive page does not exist'=>'Den ønskede arkivside for begivenhedsbegrebet findes ikke','iCal feed descriptionEvents for %s'=>'Begivenheder for %s','Event Aggregator will try to fetch %s events starting from the current date or the specified date;'=>'Hændelsesaggregatoren forsøger at hente %s hændelser fra dags dato eller den angivne dato;','Import Limit Type'=>'Importbegrænsningstype','Limit the number of imported events by number, date range, or not at all; on slower websites this may impact the success of imports. Selecting a shorter time period or a smaller number of events may improve results.'=>'Begræns antallet af importerede hændelser efter antal, datointerval eller slet ikke; på langsommere websteder kan dette have indflydelse på, om importen lykkes. Hvis du vælger en kortere tidsperiode eller et mindre antal hændelser, kan det forbedre resultaterne.','Import Date Range Limit'=>'Grænse for importdatointerval','When importing from an event source, this is how far into the future the events will be fetched; on slower websites a larger date range may impact the success of imports. Selecting a shorter time period may improve results.'=>'Når du importerer fra en hændelseskilde, er dette hvor langt ude i fremtiden, begivenhederne vil blive hentet; på langsommere websteder kan et større datointerval have indflydelse på, om importen lykkes. Hvis du vælger en kortere tidsperiode, kan det forbedre resultaterne.','The organizer could not be updated'=>'Arrangøren kunne ikke opdateres','the venue post ID'=>'stedets post-ID','The organizer could not be created from the provided data'=>'Arrangøren kunne ikke oprettes ud fra de angivne data.','The provided linked post ID is not valid'=>'Det angivne linkede indlægs-ID er ikke gyldigt','The requested venue is not accessible'=>'Det ønskede sted er ikke tilgængeligt','The requested organizer is not accessible'=>'Den ønskede arrangør er ikke tilgængelig','The organizer could not be dele