u en %s','Read more about our support policy'=>'Læs mere om vores support politik','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Bemærk venligst, at al praktisk support ydes via helpdesken. Du kan e-mail eller tweet på os ... men vi vil sandsynligvis pege dig tilbage til help desk 😄','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Der er meget få problemer, vi ikke har set, og det er sandsynligt, at en anden bruger allerede har stillet dit spørgsmål og fået et svar fra vores supportmedarbejdere. Mens opslag til help desk kun er for betalende kunder, er de åbne for alle at søge og gennemgå.','Check our Knowledgebase'=>'Tjek vores vidensdatabase','Test for a theme or plugin conflict'=>'Test om der en en konflikt med et tema eller et plugin','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. At teste om der er en eksisterende konflikt er det bedste udgangspunkt for dybdegående fejlsøgning. Ofte vil vil vi bede dig om at følge disse trin når du starter en ny tråd, så det er super hjælpsomt, hvis du gør det på forhånd.','%s. All of the common (and not-so-common) answers to questions we see are here. It’s often the fastest path to finding an answer!'=>'%s. Alle de almindelige (og ikke så almindelige) svar på spørgsmål vi ser er her. Det er ofte den hurtigste vej til at finde et svar!','Knowledgebase'=>'Vidensdatabase','Getting More Help'=>'Få mere hjælp','list of available functions'=>'liste over tilgængelige funktioner','While the resources above help solve a majority of the issues